  `public_time` datetime(0) NULL,
  `art_type` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '1:btml; 2:file doc; 3:site; 4:text',
  `tagkey` varchar(1024) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '',
