  `art_state` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '1开放、0禁用、2待审核',
  `create_time` datetime(0) NULL,
  `modify_time` datetime(0) NULL,
  `create_username` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `create_user` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `modify_username` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `modify_user` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `write_authority` char(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '1:公开; 0:本人; 2:站点; 3:禁止编辑',
  `read_authority` char(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '1:公开; 0:本人; 2:站点; 3:禁止查看',
  `runinfo_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `module` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT 'article' COMMENT '所属的模块名称',
  `module_filter_key` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '用于在某个模块下过滤的字段',
  `last_update_time` timestamp(0) NULL,
  `state` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `runinfo_id`(`runinfo_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '文章结构表' ROW_FORMAT = Dynamic;

